import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './LoginForm.css';
import { GoogleLogin } from 'react-google-login';

const LoginHome = () => {
  const navigate = useNavigate();
  const [error, setError] = useState('');

  const responseGoogleSuccess = (response) => {
    // Handle the Google Sign-In success response here
    console.log('Google Sign-In success:', response);
    // For demonstration purposes, you can navigate to the property page
    navigate('/property');
  };

  const responseGoogleFailure = (response) => {
    // Handle the Google Sign-In failure response here
    console.error('Google Sign-In failed:', response);
    setError('Google Sign-In failed. Please try again.');
  };

  return (
    <div className="container">
      <div className="lg22 form-box login-form">
        <div className=" lg2 form-group">
          <h3 className='text-center h3font' style={{ color: 'blue' }}> Login</h3>
        </div>
        <div className="google-signin">
          {/* Google Sign-In Button */}
          <GoogleLogin
            clientId="YOUR_CLIENT_ID.apps.googleusercontent.com"
            buttonText="Login with Google"
            onSuccess={responseGoogleSuccess}
            onFailure={responseGoogleFailure}
            cookiePolicy={'single_host_origin'}
          />
        </div>
        <p className="or">OR</p>
        <div className=" lg2 form-group">
          <label className='lblp'>Username:</label>
          <input
            type="text"
            className="form-control smaller-text"
            placeholder="Enter your username"
          />
        </div>
        <div className="lg2 form-group">
          <label className='lblp'>Password:</label>
          <input
            type="password"
            className="form-control smaller-text"
            placeholder="Enter your password"
          />
        </div>
        <button className="btn btn-primary smaller-button1" onClick={() => navigate('/property')}>
          Login
        </button>
        {error && <p className="error-message">{error}</p>}
      </div>
    </div>
  );
};

export default LoginHome;
